"            </td>",
"            <td valign=\"top\">",
"             <span class=\"medCalcFontOne\">",
"              <select class=\"medCalcFontSelect\" name=\"Osmolal_Gap_unit\" onchange=\"OsmolalGap_fx();\" style=\"width:105px;\">",
