"      </table>",
"     </center>",
"    </div>",
"    <br/>",
"    &nbsp;",
"    <br/>",
"    <div id=\"calc_hints\">",
"     <span class=\"medCalcFontOne\">",
"      The plasma osmolality is determined by the concentration of the different solutes in the plasma.",
"In normal subjects, sodium salts (chloride and bicarbonate), glucose, and urea are the primary",
"circulating solutes. The calculated plasma osmolality normally is between",
"270 and 290 mOsm/kg H2O and the",
"      <b>",
"       Osmolal Gap",
"      </b>",
"      is normally &lt;10 mOsm/kg H2O. You can calculate the",
"      <b>",
"       Osmolal Gap",
"      </b>",
"      from the formulas depicted.",
"     </span>",
"    </div>",
"    <br/>",
"    &nbsp;",
"    <br/>",
