"       </span>",
"      </li>",
"      <li>",
"       <span class=\"medCalcFontRef\">",
"        Purssell RA, Pudek M, Brubacher J, et. al. Derivation and validation of a formula to calculate the  contribution of ethanol to the osmolal gap.",
